    "Department of the Interior Final Environmental Assessment: Continuation of Big
    and Upland Game Hunting and the Initiation of Sambar Deer Hunting on St. Vincent
    National Wildlife Refuge",nt"tracking_summary": {ntt"total": 8,ntt"recent":
    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2016-07-27T22:20:42.900226",nt"name": "department-of-the-interior-final-environmental-assessment-continuation-of-big-and-upland-g",nt"isopen":
    false,nt"url": null,nt"notes": "The U.S. Fish and Wildlife Service (Service)
    proposes to continue upland and big game hunting and to initiate public hunting
    of the sambar deer on St. Vincent Island. The sambar deer herd will be reduced to
    approximately 100 and maintained at that level through annual removals equivalent
    to annual recruitment. The proposed actions will be carried out under authorities
    contained in the Refuge Recreation Act of 1962 and the National Wildlife Refuge
    Administration Act of 1966, as amended. Approximately 11,450 acres of the 12,358
    acre island will be open to hunting. Hunting will be allowed within the framework
    established by the Florida Game and Fresh Water Fish Commission (FGFWFC). Proposed
    hunting will not endanger any threatened/endangered species. Annual hunt proposals,
    coordinated with the FGFWFC will specify species, hunting methods, seasons, bags
    and refuge specific regulations.",nt"license_title": "License Not Specified",nt"extras":
